        function copyIFSC() {
            const ifscCode = document.getElementById('ifsc-code-display').innerText;
            navigator.clipboard.writeText(ifscCode).then(() => {
                showFlashMessage('Copied');
            }).catch(err => {
                console.error('Failed to copy text: ', err);
            });
        }

        function showFlashMessage(message) {
            const flashMessageDiv = document.getElementById('flash-message');
            flashMessageDiv.innerText = message;
            flashMessageDiv.style.visibility = 'visible';

            setTimeout(() => {
                flashMessageDiv.style.visibility = 'hidden';
            }, 3000); // Hide after 3 seconds
        }

        $(document).ready(function () {
            // Initialize Select2 on all elements with the select2 class and their placeholders
            $('.select2').select2({
                placeholder: function () {
                    return $(this).data('placeholder');
                },
                allowClear: true
            });

            // Function to load dropdown options dynamically
            window.loadDropdown = function (parent, parentValue) {
                console.log(`Loading dropdown for parent: ${parent}, value: ${parentValue}`); // Debugging

                let url = `?action=load_dropdown&parent=${parent}&parent_value=${encodeURIComponent(parentValue)}`;

                if (parent === 'state') {
                    const selectedBank = $('#bank-dropdown').val();
                    url += `&selected_bank=${encodeURIComponent(selectedBank)}`;
                } else if (parent === 'city2') {
                    const selectedBank = $('#bank-dropdown').val();
                    const selectedState = $('#state-dropdown').val();
                    url += `&selected_bank=${encodeURIComponent(selectedBank)}&selected_state=${encodeURIComponent(selectedState)}`;
                } else if (parent === 'city1') {
                    const selectedBank = $('#bank-dropdown').val();
                    const selectedState = $('#state-dropdown').val();
                    const selectedCity2 = $('#city2-dropdown').val();
                    url += `&selected_bank=${encodeURIComponent(selectedBank)}&selected_state=${encodeURIComponent(selectedState)}&selected_city2=${encodeURIComponent(selectedCity2)}`;
                }

                fetch(url, {
                    headers: {'X-Requested-With': 'XMLHttpRequest'}
                })
                    .then(response => response.json())
                    .then(data => {
                        console.log(`Received data for ${parent}:`, data); // Debugging

                        let selectId = parent === 'bank' ? 'state-dropdown' :
                            parent === 'state' ? 'city2-dropdown' :
                                parent === 'city2' ? 'city1-dropdown' :
                                    'branch-dropdown';
                        let select = $(`#${selectId}`);
                        select.empty().append('<option value="">Select an option</option>');
                        data.values.forEach(value => {
                            select.append(`<option value="${value}">${value}</option>`);
                        });
                        select.trigger('change'); // Refresh the Select2 dropdown
                    });
            }

            // Function to load table data dynamically
            window.loadTable = function () {
                const bank = $('#bank-dropdown').val();
                const state = $('#state-dropdown').val();
                const city2 = $('#city2-dropdown').val();
                const city1 = $('#city1-dropdown').val();
                const branch = $('#branch-dropdown').val();

                // Only proceed if a branch is selected
                if (branch) {
                    fetch(`?action=load_table&bank=${bank}&state=${state}&city2=${city2}&city1=${city1}&branch=${branch}`, {
                        headers: {'X-Requested-With': 'XMLHttpRequest'}
                    })
                        .then(response => response.json())
                        .then(data => {
                            console.log(`Received table data:`, data); // Debugging


                            if (data.branches && data.branches.length > 0) {
                                const branchDetails = `
                        <table class="table table-striped table-bordered">
                            <tbody>
                                <tr><th>IFSC Code</th><td>${data.branches[0].ifsc}</td></tr>
                                <tr><th>Bank</th><td>${data.branches[0].bank}</td></tr>
                                <tr><th>Branch</th><td>${data.branches[0].branch}</td></tr>
                                <tr><th>Address</th><td>${data.branches[0].address}</td></tr>
                                <tr><th>City</th><td>${data.branches[0].city1}</td></tr>
                                <tr><th>District</th><td>${data.branches[0].city2}</td></tr>
                                <tr><th>State</th><td>${data.branches[0].state}</td></tr>
                                <tr><th>STD Code</th><td>${data.branches[0].std_code}</td></tr>
                                <tr><th>Phone</th><td>${data.branches[0].phone}</td></tr>
                            </tbody>
                        </table>
                    `;

                                $('#branch-details-ifsc .ifsc-code').text(data.branches[0].ifsc);
                                $('#branch-details').html(branchDetails);
                                $('#ifsc-filter-form').hide();  // Hide the form
                                $('#branch-details-container').show(); // Show the details container
                            } else {
                                console.log('No branch details found.'); // Debugging
                                $('#error-message').text('No branch details found.').show();
                            }
                        })
                        .catch(error => {
                            console.error('Error fetching branch details:', error); // Log errors
                        });
                }
            }

            // Function to reload the page when the back button is clicked
            window.goBack = function () {
                window.location.reload(); // Reload the page
            };

            // Load states for the pre-selected bank when the page loads
            const initialBank = $('#bank-dropdown').val();
            if (initialBank) {
                loadDropdown('bank', initialBank);
            }

            // Add event listener to clear/reset button
            $('#reset-button').on('click', function () {
                window.location.reload(); // Reload the page
            });
        });


