        $(document).ready(function () {
            function loadBranches(page = 1) {
                var state = $('#state').val();
                var city1 = $('#city1').val();
                var city2 = $('#city2').val();
                var branch = $('#branch').val();

                $.ajax({
                    url: '/ifsc-code/bank/sbi-state-bank-of-india',
                    data: {
                        state: state,
                        city1: city1,
                        city2: city2,
                        branch: branch,
                        page: page
                    },
                    success: function (data) {
                        var branchesTable = $('#branches-table');
                        branchesTable.empty();

                        if (data.branches.length > 0) {
                            $.each(data.branches, function (index, branch) {
                                var detailUrl = '/ifsc-code/IFSC_CODE_PLACEHOLDER'.replace('IFSC_CODE_PLACEHOLDER', branch.ifsc.toLowerCase());
                                branchesTable.append(
                                    '<tr>' +
                                    '<td>' + capitalizeWords(branch.branch) + '</td>' +
                                    '<td><a href="' + detailUrl + '">' + branch.ifsc.toUpperCase() + '</a></td>' +
                                    '<td>' + capitalizeWords(branch.address) + '</td>' +
                                    '<td>' + capitalizeWords(branch.city1) + '</td>' +
                                    '<td>' + capitalizeWords(branch.city2) + '</td>' +
                                    '<td>' + capitalizeWords(branch.state) + '</td>' +
                                    '<td>' + branch.std_code + '</td>' +
                                    '<td>' + branch.phone + '</td>' +
                                    '</tr>'
                                );
                            });
                        } else {
                            branchesTable.append('<tr><td colspan="8">No branches found.</td></tr>');
                        }

                        updatePagination(data.page, data.num_pages, data.has_next, data.has_previous);
                    },
                    error: function (xhr, status, error) {
                        console.error('AJAX Error:', status, error);
                    }
                });
            }

            function capitalizeWords(string) {
                if (typeof string !== 'string') return '';
                return string.replace(/\w\S*/g, function (txt) {
                    return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase();
                });
            }

            function updatePagination(page, numPages, hasNext, hasPrevious) {
                var pagination = $('#pagination-links');
                pagination.empty();

                var queryString = new URLSearchParams(window.location.search);
                if (page > 1) {
                    queryString.set('page', page);
                } else {
                    queryString.delete('page');
                }

                var baseUrl = queryString.toString() ? '?' + queryString.toString() : '';

                if (hasPrevious) {
                    pagination.append('<a href="' + baseUrl.replace(/page=\d+/, '') + '" class="page-link pagination-link" data-page="1">First</a>');
                    pagination.append('<a href="' + (page - 1 > 1 ? baseUrl.replace(/page=\d+/, 'page=' + (page - 1)) : baseUrl.replace(/page=\d+/, '')) + '" class="page-link pagination-link" data-page="' + (page - 1) + '">Previous</a>');
                }

                var start = Math.max(page - 2, 1);
                var end = Math.min(page + 2, numPages);

                for (var i = start; i <= end; i++) {
                    pagination.append('<a href="' + (i > 1 ? baseUrl.replace(/page=\d+/, 'page=' + i) : baseUrl.replace(/page=\d+/, '')) + '" class="page-link pagination-link ' + (i === page ? 'active' : '') + '" data-page="' + i + '">' + i + '</a>');
                }

                if (hasNext) {
                    pagination.append('<a href="' + baseUrl.replace(/page=\d+/, 'page=' + (page + 1)) + '" class="page-link pagination-link" data-page="' + (page + 1) + '">Next</a>');
                    pagination.append('<a href="' + baseUrl.replace(/page=\d+/, 'page=' + numPages) + '" class="page-link pagination-link" data-page="' + numPages + '">Last</a>');
                }

                var backToFirstPage = $('#back-to-first-page');
                backToFirstPage.empty();

                if (page > 1) {
                    backToFirstPage.append('<a href="' + baseUrl.replace(/page=\d+/, '') + '" class="btn btn-primary pagination-link" data-page="1">Back to First Page</a>');
                }
            }

            function getPageFromURL() {
                var urlParams = new URLSearchParams(window.location.search);
                return urlParams.get('page') ? parseInt(urlParams.get('page')) : 1;
            }

            $('#searchForm input').on('keyup', function () {
                loadBranches();
            });

            $(document).on('click', '.pagination-link', function (e) {
                e.preventDefault();
                var page = $(this).data('page');
                loadBranches(page);
                var queryString = new URLSearchParams(window.location.search);
                if (page > 1) {
                    queryString.set('page', page);
                } else {
                    queryString.delete('page');
                }
                var newUrl = queryString.toString() ? '?' + queryString.toString() : window.location.pathname;
                window.history.pushState(null, '', newUrl);
            });

            // Load branches for the initial state filter, taking the page parameter into account
            loadBranches(getPageFromURL());
        });
    